Move controls the way you use references and helps you prevent unexpected bullet in your foot. To understand that let's see an example. I'll give you a module and a script and then will comment on what's going on and why. module Borrow { struct B { value: u64 } struct A { b: B } // create A with inner B public fun create(value: u64): A { A { b: B { c: C { value } } } } // give a mutable reference to inner B public fun ref_from_mut_a(a: &mut A): &mut B { &mut a.b } // change B public fun change_b(b: &mut B, value: u64) { b.value = value; }
} script { use {{sender}}::Borrow; fun main() { // create a struct A { b: B { value: u64 } } let a = Borrow::create(0); // get mutable reference to B from mut A let mut_a = &mut a; let mut_b = Borrow::ref_from_mut_a(mut_a); // change B Borrow::change_b(mut_b, 100000); // get another mutable reference from A let _ = Borrow::ref_from_mut_a(mut_a); }
} This code compiles and runs without errors. First, what happens here: we use mutable reference to A to get mutable reference to its inner struct B. Then we change B. Then operation can be repeated. But what if we've swapped two last expressions and first tried to create a new mutable reference to A while mutable reference to B is still alive? let mut_a = &mut a;
let mut_b = Borrow::ref_from_mut_a(mut_a); let _ = Borrow::ref_from_mut_a(mut_a); Borrow::change_b(mut_b, 100000); We would have gotten an error: ┌── /scripts/script.move:10:17 ─── │ 10 │ let _ = Borrow::ref_from_mut_a(mut_a); │ ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ Invalid usage of reference as function argument. Cannot transfer a mutable reference that is being borrowed · 8 │ let mut_b = Borrow::ref_from_mut_a(mut_a); │ ----------------------------- It is still being mutably borrowed by this reference │ This code won't compile. Why? Because &mut A is being borrowed by &mut B. If we could change A while having mutable reference to its contents, we'd get into an odd situation where A can be changed but reference to its contents is still here. Where would mut_b point to if there was no actual B? We come to few conclusions: We get a compilation error which means that the Move compiler prevents these cases. It's called borrow checking (originally concept from Rust language). Compiler builds a borrow graph and disallows moving borrowed values . This is one of the reasons why Move is so safe to use in blockchains. You can create reference from reference, so that original reference will be borrowed by the new one. Mutable and immutable can be created from mutable and only immutable from immutable. When reference is borrowed it cannot be moved because other values depend on it.

