} Remember signer ? Now you see how it in action! To move resource to account you have built-in function move_to which takes signer as a first argument and T as second. Signature of move_to function could be represented like: native fun move_to<T: resource>(account: &signer, value: T); That leads to two conclusions: You can only put a resource under your account. You cannot have access to signer value of another account, hence cannot put resource there. Only one resource of single type can be stored under one address. Doing the same operation twice would lead to discarding existing resource and this must not happen (imagine you have your coins stored and by inaccurate action you discard all your savings by pushing empty balance!). Second attempt to create existing resource will fail with error.

